# 获取分割结果
seg = seg_res()

# 深度相机内参
width, height, fx, fy, cx, cy = 1280, 1024, 1720.04, 1720.61, 628.632, 481.287
intrinsic = o3d.camera.PinholeCameraIntrinsic(width, height, fx, fy, cx, cy)

# 深度图
depth_path = r'D:\work\c++\pcd_test\1_depth.tiff'
# 读取深度图
depth_PIL = Image.open(depth_path)
# 深度图转为array
depth_array = np.array(depth_PIL)

size = (1024,1280)
# 创建新的空深度图单独存放内油孔
new_depth_hole = np.zeros(size,dtype=np.float32)

# 内油孔分割结果
hole_seg = seg['oil hole']
# 根据分割结果单独将hole的深度信息转移到新hole深度图中
for hole_point in hole_seg:
    new_depth_hole[hole_point[1],hole_point[0]] = depth_array[hole_point[1],hole_point[0]]
# 将新hole深度图转为点云
# o3d读取取油孔的深度图的点集
depth_raw = o3d.geometry.Image(new_depth_hole)
# 通过油孔的深度图获取点云
hole_pcd = o3d.geometry.PointCloud.create_from_depth_image(depth_raw, intrinsic)
o3d.visualization.draw_geometries([hole_pcd])#可视化点云文件
o3d.io.write_point_cloud("./hole_pcd.ply", hole_pcd)
# 对hole点云添加颜色
hole_pcd.paint_uniform_color([1, 0, 0])

################################# o3d读取原始深度图的点集 ##################################
depth_origin_raw = o3d.geometry.Image(depth_array)
# 通过原始深度图 获取原始点云
origin_pcd = o3d.geometry.PointCloud.create_from_depth_image(depth_origin_raw, intrinsic)
origin_pcd.paint_uniform_color([0, 1, 0])
##########################################################################################
# 对点云添加坐标系
axis = o3d.geometry.TriangleMesh.create_coordinate_frame(size=100, origin=[0, 0, 0])
# o3d.visualization.draw_geometries([pick_pcd, hole_pcd, origin_pcd, axis])
o3d.visualization.draw_geometries([hole_pcd, origin_pcd, axis])

# 三维点集拟合圆
aaa = ra3d.Circle()
center, normal, radius, inliers = aaa.fit(np.asarray(hole_pcd.points), thresh=5, maxIteration=100)
print('center:',center)
print('normal:',normal)
print('radius:',radius)
print('inliers:',inliers)
R = ra3d.get_rotationMatrix_from_vectors([0, 0, 1], normal)
in1 = hole_pcd.select_by_index(inliers).paint_uniform_color([1, 0, 0])
out = hole_pcd.select_by_index(inliers, True).paint_uniform_color([0, 1, 0])
axis = o3d.geometry.TriangleMesh.create_coordinate_frame(size=100, origin=[0, 0, 0])
mesh_circle = o3d.geometry.TriangleMesh.create_torus(torus_radius=radius, tube_radius=1)
mesh_circle.compute_vertex_normals()
mesh_circle.paint_uniform_color([0, 0, 1])
mesh_circle = mesh_circle.rotate(R, center=[0, 0, 0])
mesh_circle = mesh_circle.translate((center[0], center[1], center[2]))
o3d.visualization.draw_geometries([in1, out, mesh_circle, axis])
